window.bookSummaryJSON = "<p><b>Nolan Garrett is Cerberus. A government assassin, tasked with fixing the galaxy's darkest, ugliest problems.</b>&nbsp;</p> <p>Three thrilling novels featuring fearless heroes, non-stop futuristic action, and neck-breaking plot twists.&nbsp;</p> <p>Armed with cutting-edge weapons and an AI-run cybernetic suit that controls his paralyzed legs, he is the fist in the shadows, the dagger to the heart of the Nyzarian Empire’s enemies.&nbsp;</p> <p>Then, he found Bex on his doorstep....</p> <p>A junkie, high on the drug he’d fought for years to avoid, and a former elite soldier like him. So he takes her in to help her get clean - Silverguards never leave their own behind.&nbsp;</p> <p>If only he’d known his actions would put him in the crosshairs of the most powerful cartel in New Avalon.&nbsp;</p> <p>Facing an army of gangbangers, drug pushers, and thugs, Nolan must fight to not only carry out his mission, but to prevent the escalating violence from destroying everything he loves.&nbsp;</p> <p><b>This Special Edition Omnibus contains the first three books in the thrilling Cerberus military space opera series. It's perfect for fans of JN Chaney, Jay Allan, and Rick Partlow. Grab your copy today!</b>&nbsp;</p> <p><b>Books included in the set:</b>&nbsp;</p> <p>Book One: <i>Assassination Protocol </i><br> Book Two: <i>Terminal Secrets</i> <br> Book Three: <i>Cyber Strike</i></p>"; 
